import torch
import torch.nn as nn
import torch.nn.functional as F


class Model(nn.Module):
    def __init__(self) -> None:
        super().__init__()
        self.bn1 = nn.BatchNorm3d(10)
        self.bn2 = nn.BatchNorm3d(20)
        self.bn3 = nn.BatchNorm3d(30)
        self.lrelu1 = nn.LeakyReLU()
        self.lrelu2 = nn.LeakyReLU()
        self.lrelu3 = nn.LeakyReLU()
        self.lrelu4 = nn.LeakyReLU()
        self.lrelu5 = nn.LeakyReLU()
        self.mse_loss = nn.MSELoss()

    def forward(self, x):
        # Assuming input x is of shape (batch_size, channels, depth, height, width)
        x = self.bn1(x)
        x = self.lrelu1(x)
        x = self.bn2(x)
        x = self.lrelu2(x)
        x = self.bn3(x)
        x = self.lrelu3(x)
        
        # Reshape to match the expected input shape for MSELoss
        x = x.view(x.size(0), -1)  # Flatten the tensor
        target = torch.zeros_like(x)  # Create a target tensor for MSELoss
        loss = self.mse_loss(x, target)
        
        return loss


